import './style.css';




function Skills(props) {

  return (


    <div className="skills-div ">

      <div className="skills">
        <h2 id="h2-skills">Chatbot</h2>
        <p>Utilizando o pacote react-chatbot-kit, criei um chatbot simples para responder perguntas frequentes em entrevistas e recrutamentos</p>
        <p>Para conferir as respostas disponíveis pergunte:<br/>'O que você sabe responder?'</p>
      </div>

      <button className="btn-chat" onClick={e => setWorkHistory({
          element:       
          <div className="chat-container">
          <Chatbot 
              config={config}
              actionProvider={ActionProvider}
              messageParser={MessageParser}
              headerText= "VINIBOT - Informações extras"
          />
        </div>
        })}>Falar com Vinibot</button>

      
    </div>


  )



}


export default Skills;
